const events = [
    {
        id: 1,
        text: 'Birthday event',
        time: 'abcd',
        registered: false,
    },
    {
        id: 2,
        text: 'Anniversary event',
        time: 'abcd',
        registered: true,
    }
]

const Events = () => {
    return (
        <div className="events">
            {events.map((eve) => (<h3>{eve.text}</h3>))}
        </div>
    )
}

export default Events
